1	f	What is the DACP Database?	It is a system used by The Divorce section of the PRFD
2	f	Who supports the system?	The system was developed, and is supported by, Solutions Development, a part of MoJ ICT.  All help call sshould be raised via the Atos Servicedesk on 0800 7830162
3	t	If I have a problem, how do I raise a call?	Call the Atos Service desk on 0800 7830162
4	t	Why is data missing for a known Divorce or Dissolution?	Data in the application has come from three different sources. Firstly, a legacy database which had known gaps in the data. Secondly, An ONS monthly upload which would also miss out records where the numbers in a given month were beyond approximately 66 thousand, and the FamilyMan DataUpload which may have not yet been performed for the record you are looking for.
5	t	Why is there more than one proceeding for a given Divorce or Dissolution in the system?	The ONS data would sometimes contain more than one record for a given Proceeding, and the Familyman data upload loads every change to a record - resulting in multiple records for a given proceeding. Given that there was no reliable way to determine that a specific row in the Familyman Data Upload corresponds to an existing proceeding. The Divorce Section approved this data.
6	t	Why are there sometimes more than two parties for one proceeding?	The ONS data often contained this situation - with no reliable way to determine which parties where the correct one, The Divorce Section decided to migrate all of them to the current application.
7	t	Why did a No Trace seach for a Civil Partnership print out as a no Trace Divorce?	You MUST include the Union Type in your search criteria for the system to know which type of letter to print as no other data on the union exists on the system.
\.


